import Board from '../../board';
import { useRouter } from 'next/router';
import { useEffect } from 'react';

export default function Project() {
  const router = useRouter();
  const { id, project } = router.query;
  console.log(id, project);
  const storageString = 'omegakanbanprojects';
  const prevProjects = localStorage.getItem(storageString) as any;
  if (prevProjects.project) {
    const isNew = prevProjects.filter(
      (project: any) => project.project !== project
    );
    if (isNew) {
      localStorage.setItem(storageString, [
        ...prevProjects,
        { id, project },
      ] as any);
    }
  } else {
    localStorage.setItem(storageString, [
      JSON.stringify({ id, project }),
    ] as any);
  }

  return <Board id={id} project={project} />;
}
